import {  } from "react-icons";


export const Footer = () => {
  return (
    <>
      <div className='footer'>
         <div className='footer-container'>
          <div className='left-container'>
            <Facebook size={20} style={{color:"white"}}  />
          </div>
          <div className='right-container'></div>
         </div>
      </div>
    </>
  )
}
